import React from 'react';
import { useTranslation } from 'react-i18next';

const Profile = () => {
    const { t } = useTranslation();

    return (
        <section id="profile" className="max-w-screen-2xl w-full mx-auto flex flex-col items-start justify-center text-left my-32 px-8 md:px-16">
            <h2 className='mb-8 text-4xl'>{t('profile')}</h2>
            <hr className='border-white/10 w-full'></hr>
            <div className='mt-24 w-full flex flex-col items-end'>
                <span className='text-4xl font-extralight max-w-4xl'>I'm Joschka Kreusser, a digital designer based in Munich crafting visual personalities for digital-first brands. I'm a generalist by design always up for new challenges, well versed in taking a vision and helping turn that into a living breathing entity. I love my work and that’s why I always strive for the best results. If it doesn’t meet the highest standards it won’t leave my desk.</span>
            </div>
        </section>
    );
}

export default Profile;
